void ofxOfeliaBlOsc::triangle(float *io1, int n1)
{
    const t_float sr = sys_getsr();
    const t_float nyquist = sr * 0.5f;
    int normhipart, normhipart2;
    union tabfudge tf, tf2;
    const t_float conv = 1.0f / sr;
    
    /* phasor~ */
    double dphase = this->phase + UNITBIT32 + 0.25;
    tf.tf_d = UNITBIT32;
    normhipart = tf.tf_i[HIOFFSET];
    tf.tf_d = dphase;
    
    /* tabosc4~ */
    const t_float fnpoints = 512.0f;
    const t_float finvnpoints = 1.0f / fnpoints;
    const int mask = fnpoints - 1;
    const t_float conv2 = fnpoints * conv;
    double dphase2 = fnpoints * this->phase2 + UNITBIT32;
    tf2.tf_d = UNITBIT32;
    normhipart2 = tf2.tf_i[HIOFFSET];
    
    for (int i = 0; i < n1; ++i)
    {
        /* filter out inf */
        t_float nf = nyquist / io1[i];
        if (PD_BIGORSMALL(nf)) nf = 0.0f;
        
        /* bandlimited numHarmonics range 1~TABNUM */
        const int numHarmonics = abs(static_cast<int>((static_cast<int>(nf) - 1) * 0.5) + 1);
        if (numHarmonics > TABNUM_TRIANGLE)
        {
            /* sync phase when changed */
            if (!isRawMode)
            {
                tf2.tf_d = UNITBIT32 * fnpoints;
                normhipart2 = tf2.tf_i[HIOFFSET];
                tf2.tf_d = dphase2 + (UNITBIT32 * fnpoints - UNITBIT32);
                tf2.tf_i[HIOFFSET] = normhipart2;
                this->phase2 = (tf2.tf_d - UNITBIT32 * fnpoints) * finvnpoints;
                this->phase = this->phase2 - 0.75;
                dphase = this->phase + UNITBIT32;
                tf.tf_d = dphase;
                isRawMode = true;
            }
            /* phasor~ */
            tf.tf_i[HIOFFSET] = normhipart;
            dphase += io1[i] * conv;
            const double phasor = tf.tf_d - UNITBIT32;
            
            /* output raw waveform */
            if (phasor <= 0.5)
                io1[i] = (phasor - 0.25) * 4.0;
            else
                io1[i] = ((1.0 - phasor) - 0.25) * 4.0;
            tf.tf_d = dphase;
        }
        else
        {
            /* sync phase when changed */
            if (isRawMode)
            {
                this->phase2 = tf.tf_d - UNITBIT32 + 0.75;
                dphase2 = fnpoints * this->phase2 + UNITBIT32;
                isRawMode = false;
            }
            /* tabosc4~ */
            t_sample frac, a, b, c, d, cminusb;
            tf2.tf_d = dphase2;
            dphase2 += io1[i] * conv2;
            
            if (numHarmonics >= 1)
            {
                t_float *addr = blTriangleTab[static_cast<size_t>(numHarmonics-1)] + (tf2.tf_i[HIOFFSET] & mask);
                tf2.tf_i[HIOFFSET] = normhipart2;
                frac = tf2.tf_d - UNITBIT32;
                a = addr[0];
                b = addr[1];
                c = addr[2];
                d = addr[3];
                cminusb = c-b;
                
                /* output bandlimited waveform */
                io1[i] = b + frac * (cminusb - 0.1666667f * (1.-frac) * ((d - a - 3.0f * cminusb) * frac + (d + 2.0f*a - 3.0f*b)));
            }
            else
            {
                /* mute when frequency is above nyquist */
                io1[i] = 0.0f;
            }
        }
    }
    /* phasor~ */
    tf.tf_i[HIOFFSET] = normhipart;
    this->phase = tf.tf_d - UNITBIT32 - 0.25;
    
    /* tabosc4~ */
    tf2.tf_d = UNITBIT32 * fnpoints;
    normhipart2 = tf2.tf_i[HIOFFSET];
    tf2.tf_d = dphase2 + (UNITBIT32 * fnpoints - UNITBIT32);
    tf2.tf_i[HIOFFSET] = normhipart2;
    this->phase2 = (tf2.tf_d - UNITBIT32 * fnpoints) * finvnpoints;
}

