void ofxOfeliaBlOsc::pulse(float *io1, int n1, float *in2, int n2)
{
    const t_float sr = sys_getsr();
    const t_float nyquist = sr * 0.5f;
    int normhipart, normhipart2, normhipart3;
    union tabfudge tf, tf2, tf3;
    const t_float modin2 = in2[0] * 0.5f + 0.5f;
    const t_float pw = modin2 - floorf(modin2);
    const t_float ipw = 1.0f - pw;
    const t_float conv = 1.0f / sr;
    
    /* phasor~ */
    double dphase = this->phase + UNITBIT32;
    tf.tf_d = UNITBIT32;
    normhipart = tf.tf_i[HIOFFSET];
    tf.tf_d = dphase;
    
    /* tabosc4~ */
    const t_float fnpoints = 512.0f;
    const t_float finvnpoints = 1.0f / fnpoints;
    const int mask = fnpoints - 1;
    const t_float conv2 = fnpoints * conv;
    double dphase2 = fnpoints * this->phase2 + UNITBIT32;
    tf2.tf_d = UNITBIT32;
    normhipart2 = tf2.tf_i[HIOFFSET];
    
    /* tabosc4~ */
    t_float fnpoints2 = fnpoints;
    int mask2 = fnpoints2 - 1;
    const t_float conv3 = fnpoints2 * conv;
    double phase3 = this->phase2 + ipw;
    double dphase3 = fnpoints2 * phase3 + UNITBIT32;
    tf3.tf_d = UNITBIT32;
    normhipart3 = tf3.tf_i[HIOFFSET];
    
    for (int i = 0; i < n1; ++i)
    {
        /* filter out inf */
        t_float nf = nyquist / io1[i];
        if (PD_BIGORSMALL(nf)) nf = 0.0f;
        
        /* bandlimited numHarmonics range 1~TABNUM */
        const int numHarmonics = abs(static_cast<int>(nf));
        if (numHarmonics > TABNUM_SAW)
        {
            /* sync phase when changed */
            if (!isRawMode)
            {
                tf2.tf_d = UNITBIT32 * fnpoints;
                normhipart2 = tf2.tf_i[HIOFFSET];
                tf2.tf_d = dphase2 + (UNITBIT32 * fnpoints - UNITBIT32);
                tf2.tf_i[HIOFFSET] = normhipart2;
                this->phase2 = (tf2.tf_d - UNITBIT32 * fnpoints) * finvnpoints;
                this->phase = this->phase2;
                dphase = this->phase + UNITBIT32;
                tf.tf_d = dphase;
                isRawMode = true;
            }
            /* phasor~ */
            tf.tf_i[HIOFFSET] = normhipart;
            dphase += io1[i] * conv;
            const double phasor = tf.tf_d - UNITBIT32;
            const t_float modin3 = in2[i] * 0.5f + 0.5f;
            const t_float pw2 = modin3 - floorf(modin3);
            
            /* output raw waveform */
            if (phasor < pw2)
                io1[i] = 1.0f;
            else
                io1[i] = -1.0f;
            tf.tf_d = dphase;
        }
        else
        {
            /* sync phase when changed */
            if (isRawMode)
            {
                this->phase2 = tf.tf_d - UNITBIT32;
                dphase2 = fnpoints * this->phase2 + UNITBIT32;
                const double modphase = this->phase2 + ipw + 1.0;
                phase3 = modphase - floor(modphase);
                dphase3 = fnpoints2 * phase3 + UNITBIT32;
                isRawMode = false;
            }
            /* tabosc4~ */
            t_sample frac, a, b, c, d, cminusb;
            tf2.tf_d = dphase2;
            dphase2 += io1[i] * conv2;
            
            /* tabosc4~ */
            t_sample frac2, a2, b2, c2, d2, cminusb2;
            tf3.tf_d = dphase3;
            dphase3 += io1[i] * conv3;
            
            if (numHarmonics >= 1)
            {
                t_float *addr = blSawTab[static_cast<size_t>(numHarmonics-1)] + (tf2.tf_i[HIOFFSET] & mask);
                tf2.tf_i[HIOFFSET] = normhipart2;
                frac = tf2.tf_d - UNITBIT32;
                a = addr[0];
                b = addr[1];
                c = addr[2];
                d = addr[3];
                cminusb = c-b;
                t_float *addr2 = blSawTab[static_cast<size_t>(numHarmonics-1)] + (tf3.tf_i[HIOFFSET] & mask2);
                tf3.tf_i[HIOFFSET] = normhipart3;
                frac2 = tf3.tf_d - UNITBIT32;
                a2 = addr2[0];
                b2 = addr2[1];
                c2 = addr2[2];
                d2 = addr2[3];
                cminusb2 = c2-b2;
                
                /* output bandlimited waveform */
                const t_float tabOut = b + frac * (cminusb - 0.1666667f * (1.-frac) * ((d - a - 3.0f * cminusb) * frac + (d + 2.0f*a - 3.0f*b)));
                const t_float tabOut2 = b2 + frac2 * (cminusb2 - 0.1666667f * (1.-frac2) * ((d2 - a2 - 3.0f * cminusb2) * frac2 + (d2 + 2.0f*a2 - 3.0f*b2)));
                io1[i] = (tabOut - tabOut2) + (pw - 0.5) * 2.0;
            }
            else
            {
                /* mute when frequency is above nyquist */
                io1[i] = 0.0f;
            }
        }
    }
    /* phasor~ */
    tf.tf_i[HIOFFSET] = normhipart;
    this->phase = tf.tf_d - UNITBIT32;
    
    /* tabosc4~ */
    tf2.tf_d = UNITBIT32 * fnpoints;
    normhipart2 = tf2.tf_i[HIOFFSET];
    tf2.tf_d = dphase2 + (UNITBIT32 * fnpoints - UNITBIT32);
    tf2.tf_i[HIOFFSET] = normhipart2;
    this->phase2 = (tf2.tf_d - UNITBIT32 * fnpoints) * finvnpoints;
}

void ofxOfeliaFilter::clear() /* clear internal state to zero */
{
    this->x1 = 0;
    this->x2 = 0;
    this->y1 = 0;
    this->y2 = 0;
}

void ofxOfeliaFilter::lowPass(float *io1, int n1, float *in2, int n2, float *in3, int n3)
{
    const t_float sr = sys_getsr();
    const t_float nyquist = sr * 0.5f;
    
    /* pull out the state into local variables */
    t_float x1 = this->x1;
    t_float x2 = this->x2;
    t_float y1 = this->y1;
    t_float y2 = this->y2;
    
    for (int i = 0; i < n1; ++i)
    {
        /* get the current sample */
        const t_float x0 = io1[i];
        
        /* clamp cutoff and resonance */
        const t_float cutoff = ofClamp(in2[i], 10.0f, nyquist-10.0f);
        const t_float res = powf(10.0f, ofClamp(in3[i], 0.0f, 40.0f) * 0.05f);
        
        /* setup variables */
        const t_float omega = TWO_PI * cutoff / sr;
        const t_float cs = cosf(omega);
        const t_float alpha = sinf(omega) / (2.0f * res);
        const t_float b1 = 1.0f - cs;
        const t_float b0 = b1 * 0.5f;
        const t_float b2 = b0;
        const t_float a0 = 1.0f + alpha;
        const t_float a1 = -2.0f * cs;
        const t_float a2 = 1.0f - alpha;
        
        /* compute result */
        const t_float y0 = (b0/a0)*x0 + (b1/a0)*x1 + (b2/a0)*x2 - (a1/a0)*y1 - (a2/a0)*y2;
        
        /* filter out NaN */
        io1[i] = PD_BIGORSMALL(y0) ? 0.0f : y0;
        
        /* shift x1 to x2, sample to x1 */
        x2 = x1;
        x1 = x0;
        
        /* shift y1 to y2, result to y1 */
        y2 = y1;
        y1 = io1[i];
    }
    /* save the state for future processing */
    this->x1 = x1;
    this->x2 = x2;
    this->y1 = y1;
    this->y2 = y2;
}

