void ofxOfeliaFilter::peaking(float *io1, int n1, float *in2, int n2,
                              float *in3, int n3, float *in4, int n4)
{
    const t_float sr = sys_getsr();
    const t_float nyquist = sr * 0.5f;
    
    /* pull out the state into local variables */
    t_float x1 = this->x1;
    t_float x2 = this->x2;
    t_float y1 = this->y1;
    t_float y2 = this->y2;
    
    for (int i = 0; i < n1; ++i)
    {
        /* get the current sample */
        const t_float x0 = io1[i];
        
        /* clamp cutoff and Q and dbGain */
        const t_float cutoff = ofClamp(in2[i], 10.0f, nyquist-10.0f);
        const t_float Q = ofClamp(in3[i], 1.0f, 100.0f);
        const t_float dbGain = ofClamp(in4[i], 0.0f, 40.0f);
        
        /* setup variables */
        const t_float A = powf(10.0f, dbGain / 40.0f);
        const t_float omega = TWO_PI * cutoff / sr;
        const t_float cs = cosf(omega);
        const t_float alpha = sinf(omega) / (2.0f * Q);
        const t_float alphaMulA = alpha * A;
        const t_float alphaDivA = alpha / A;
        const t_float b0 = 1.0f + alphaMulA;
        const t_float b1 = -2.0f * cs;
        const t_float b2 = 1.0f - alphaMulA;
        const t_float a0 = 1.0f + alphaDivA;
        const t_float a1 = b1;
        const t_float a2 = 1.0f - alphaDivA;
        
        /* compute result */
        const t_float y0 = (b0/a0)*x0 + (b1/a0)*x1 + (b2/a0)*x2 - (a1/a0)*y1 - (a2/a0)*y2;
        
        /* filter out NaN */
        io1[i] = PD_BIGORSMALL(y0) ? 0.0f : y0;
        
        /* shift x1 to x2, sample to x1 */
        x2 = x1;
        x1 = x0;
        
        /* shift y1 to y2, result to y1 */
        y2 = y1;
        y1 = io1[i];
    }
    /* save the state for future processing */
    this->x1 = x1;
    this->x2 = x2;
    this->y1 = y1;
    this->y2 = y2;
}

void ofxOfeliaFilter::lowShelf(float *io1, int n1, float *in2, int n2,
                               float *in3, int n3, float *in4, int n4)
{
    const t_float sr = sys_getsr();
    const t_float nyquist = sr * 0.5f;
    
    /* pull out the state into local variables */
    t_float x1 = this->x1;
    t_float x2 = this->x2;
    t_float y1 = this->y1;
    t_float y2 = this->y2;
    
    for (int i = 0; i < n1; ++i)
    {
        /* get the current sample */
        const t_float x0 = io1[i];
        
        /* clamp cutoff and S and dbGain */
        const t_float cutoff = ofClamp(in2[i], 10.0f, nyquist-10.0f);
        const t_float S = ofClamp(in3[i], 0.001f, 1.0f);
        const t_float dbGain = ofClamp(in4[i], 0.0f, 40.0f);
        
        /* setup variables */
        const t_float A = powf(10.0f, dbGain / 40.0f);
        const t_float omega = TWO_PI * cutoff / sr;
        const t_float cs = cosf(omega);
        const t_float alpha = sinf(omega)/2 * sqrtf((A + 1/A)*(1/S - 1) + 2);
        const t_float beta = sqrtf(A) * alpha * 2.0f;
        const t_float Aadd1 = A + 1.0f;
        const t_float Asub1 = A - 1.0f;
        const t_float b0 = A * (Aadd1 - Asub1 * cs + beta);
        const t_float b1 = 2.0f * A * (Asub1 - (A+1.0f) * cs);
        const t_float b2 = A * (Aadd1 - Asub1 * cs - beta);
        const t_float a0 = Aadd1 + Asub1 * cs + beta;
        const t_float a1 = -2.0f * (Asub1 + Aadd1 * cs);
        const t_float a2 = Aadd1 + Asub1 * cs - beta;
        
        /* compute result */
        const t_float y0 = (b0/a0)*x0 + (b1/a0)*x1 + (b2/a0)*x2 - (a1/a0)*y1 - (a2/a0)*y2;
        
        /* filter out NaN */
        io1[i] = PD_BIGORSMALL(y0) ? 0.0f : y0;
        
        /* shift x1 to x2, sample to x1 */
        x2 = x1;
        x1 = x0;
        
        /* shift y1 to y2, result to y1 */
        y2 = y1;
        y1 = io1[i];
    }
    /* save the state for future processing */
    this->x1 = x1;
    this->x2 = x2;
    this->y1 = y1;
    this->y2 = y2;
}

